import React from "react";
import Link from "next/link";

const indexpage = () => (
  <div>
    <h1>Main Page</h1>
    <p>
      Go to
      <Link href="/auth">
        <a>Auth</a>
      </Link>
    </p>
  </div>
);

export default indexpage;
